Begin
MERGE INTO films USING dual ON (film_id='#[payload.filmID]') 
WHEN MATCHED THEN UPDATE SET film_name='#[payload.film]', film_genre='#[payload.genre]' 
WHEN NOT MATCHED THEN INSERT (film_name, film_genre) 
VALUES ('#[payload.film]', '#[payload.genre]');
END;

